import React from 'react'
import { Card } from 'react-bootstrap'
import skillsData from '../../assets/skillsData.json'

const SkillsCard = () => {

   const DeploymentSkills = skillsData.filter(item=> item.category=== 'Deployment')

    return(
        <Card >
            {DeploymentSkills.map(item=>
             <Card.Body >
                <Card.Title>
                    {item.category}
                </Card.Title>
                <Card.Subtitle>
                    {item.category}
                </Card.Subtitle>
                 {item.iconLogo}
                </Card.Body>
                )}


        </Card>




    )

}

export default SkillsCard;
